INSERT INTO room_item_detail(rowid,room_item_id,level,item_detail,lvup_trigger_type,lvup_trigger_id,lvup_trigger_value,lvup_item1_type,lvup_item1_id,lvup_item1_num,lvup_time) VALUES(222,501,1,'夏の気配を感じさせるハンモック。寝苦しい日々を過ごすキミにピッタリ！　波に揺られるような心地よさの中でおやすみなさいっ。',0,0,0,0,0,0,0);
INSERT INTO room_item_detail(rowid,room_item_id,level,item_detail,lvup_trigger_type,lvup_trigger_id,lvup_trigger_value,lvup_item1_type,lvup_item1_id,lvup_item1_num,lvup_time) VALUES(223,502,1,'アラベスク模様のパーテーション。みんなでリゾート気分を楽しもう！　違った味わいを出したいなら、何枚か置いてはいかが？',0,0,0,0,0,0,0);
INSERT INTO room_item_detail(rowid,room_item_id,level,item_detail,lvup_trigger_type,lvup_trigger_id,lvup_trigger_value,lvup_item1_type,lvup_item1_id,lvup_item1_num,lvup_time) VALUES(224,503,1,'おしゃれなデザイナーズソファ。青と白のコントラストが爽快さを演出！　座っていると波音が聞こえてくるかも？',0,0,0,0,0,0,0);
INSERT INTO room_item_detail(rowid,room_item_id,level,item_detail,lvup_trigger_type,lvup_trigger_id,lvup_trigger_value,lvup_item1_type,lvup_item1_id,lvup_item1_num,lvup_time) VALUES(225,504,1,'包み込むような二人掛けソファ。一人で広々使っても、二人で仲良く座ってもいい感じ！　実はクッション部分を取り外せるよ！',0,0,0,0,0,0,0);
INSERT INTO room_item_detail(rowid,room_item_id,level,item_detail,lvup_trigger_type,lvup_trigger_id,lvup_trigger_value,lvup_item1_type,lvup_item1_id,lvup_item1_num,lvup_time) VALUES(226,505,1,'デザイン重視の食器棚。中央棚に植物や小物を置けば、おしゃれ度アップ！　インテリアとしても魅力的に！',0,0,0,0,0,0,0);
INSERT INTO room_item_detail(rowid,room_item_id,level,item_detail,lvup_trigger_type,lvup_trigger_id,lvup_trigger_value,lvup_item1_type,lvup_item1_id,lvup_item1_num,lvup_time) VALUES(227,506,1,'青を基調としたチェスト。丁度いい大きさだから、配置が簡単！　置き場に困った小物はこのチェストの上へご案内！',0,0,0,0,0,0,0);
INSERT INTO room_item_detail(rowid,room_item_id,level,item_detail,lvup_trigger_type,lvup_trigger_id,lvup_trigger_value,lvup_item1_type,lvup_item1_id,lvup_item1_num,lvup_time) VALUES(228,507,1,'爽快さを感じさせるクローゼット。時間が経っても色あせない！　鮮やかな白と青で彩りは決まり！',0,0,0,0,0,0,0);
INSERT INTO room_item_detail(rowid,room_item_id,level,item_detail,lvup_trigger_type,lvup_trigger_id,lvup_trigger_value,lvup_item1_type,lvup_item1_id,lvup_item1_num,lvup_time) VALUES(229,508,1,'背もたれありの青い丸椅子。実は結構柔らかい素材で出来ているので、座り心地がグッド！',0,0,0,0,0,0,0);
INSERT INTO room_item_detail(rowid,room_item_id,level,item_detail,lvup_trigger_type,lvup_trigger_id,lvup_trigger_value,lvup_item1_type,lvup_item1_id,lvup_item1_num,lvup_time) VALUES(230,509,1,'背もたれなしの青い丸椅子。シンプルで愛らしいシルエットは、幅広い層に人気！',0,0,0,0,0,0,0);
INSERT INTO room_item_detail(rowid,room_item_id,level,item_detail,lvup_trigger_type,lvup_trigger_id,lvup_trigger_value,lvup_item1_type,lvup_item1_id,lvup_item1_num,lvup_time) VALUES(231,510,1,'汎用性が高い吊り棚。色々なところに吊れて便利！　壁に彩りが欲しい時にもどうぞ！',0,0,0,0,0,0,0);
INSERT INTO room_item_detail(rowid,room_item_id,level,item_detail,lvup_trigger_type,lvup_trigger_id,lvup_trigger_value,lvup_item1_type,lvup_item1_id,lvup_item1_num,lvup_time) VALUES(232,511,1,'上品さを漂わせる白いテーブル。このテーブルの上で手紙を書けばとてもリッチな気分になれるかも…！？　青のテーブルクロスはセットなのでとってもお得！',0,0,0,0,0,0,0);
