INSERT INTO room_unit_comments(rowid,id,unit_id,"trigger",voice_id,beloved_step,time,face_id,description,insert_word_type) VALUES(2244,2387,107701,1,1,1,0,1,'お掃除、お掃除\nふんふふ～ん☆\nあ、聞かれてました？',0);
INSERT INTO room_unit_comments(rowid,id,unit_id,"trigger",voice_id,beloved_step,time,face_id,description,insert_word_type) VALUES(2245,2388,107701,1,2,1,0,1,'日焼けには回復魔法が\n効きますよ。どうして\n逃げるんですか～！',0);
INSERT INTO room_unit_comments(rowid,id,unit_id,"trigger",voice_id,beloved_step,time,face_id,description,insert_word_type) VALUES(2246,2389,107701,1,3,1,0,1,'今日はドジを\nしませんように！',0);
INSERT INTO room_unit_comments(rowid,id,unit_id,"trigger",voice_id,beloved_step,time,face_id,description,insert_word_type) VALUES(2247,2390,107701,1,4,1,0,1,'接客業を極めれば\nメイドとして\n成長できるかも？',0);
INSERT INTO room_unit_comments(rowid,id,unit_id,"trigger",voice_id,beloved_step,time,face_id,description,insert_word_type) VALUES(2248,2391,107701,1,5,1,0,1,'水着って\n動きやすいんですけど\n人の目が気になります',0);
INSERT INTO room_unit_comments(rowid,id,unit_id,"trigger",voice_id,beloved_step,time,face_id,description,insert_word_type) VALUES(2249,2392,107701,1,101,4,0,1,'あの人の気持ちを知る\n魔法とかあれば…\nな、なんでもないです',0);
INSERT INTO room_unit_comments(rowid,id,unit_id,"trigger",voice_id,beloved_step,time,face_id,description,insert_word_type) VALUES(2250,2393,107701,1,102,8,0,1,'水着でご奉仕したら、\nあの人は喜ぶかな？',0);
INSERT INTO room_unit_comments(rowid,id,unit_id,"trigger",voice_id,beloved_step,time,face_id,description,insert_word_type) VALUES(2251,2394,107701,2,1,1,0,1,'暑いのでしたら、\n私が魔法で涼しく…\nえ？　いらない？',0);
INSERT INTO room_unit_comments(rowid,id,unit_id,"trigger",voice_id,beloved_step,time,face_id,description,insert_word_type) VALUES(2252,2395,107701,2,2,1,0,1,'何か御用ですか？\n特にないのでしたら、\nお話ししましょう♪',0);
INSERT INTO room_unit_comments(rowid,id,unit_id,"trigger",voice_id,beloved_step,time,face_id,description,insert_word_type) VALUES(2253,2396,107701,2,3,1,0,1,'水着姿でも\nメイドはメイドです\nご奉仕しますよ！',0);
INSERT INTO room_unit_comments(rowid,id,unit_id,"trigger",voice_id,beloved_step,time,face_id,description,insert_word_type) VALUES(2254,2397,107701,2,4,1,0,1,'ひゃっ！　あ、危うく\n転ぶところでした…\n…きゃうっ！',0);
INSERT INTO room_unit_comments(rowid,id,unit_id,"trigger",voice_id,beloved_step,time,face_id,description,insert_word_type) VALUES(2255,2398,107701,2,101,4,0,1,'どうかしましたか？\nあなたの御用なら、\n喜んでお受けしますよ',0);
INSERT INTO room_unit_comments(rowid,id,unit_id,"trigger",voice_id,beloved_step,time,face_id,description,insert_word_type) VALUES(2256,2399,107701,2,102,8,0,1,'水着姿をあなたに\n見られると、\nドキドキしちゃいます',0);
INSERT INTO room_unit_comments(rowid,id,unit_id,"trigger",voice_id,beloved_step,time,face_id,description,insert_word_type) VALUES(2257,2400,107701,2,1,1,1,1,'朝は暑くてやる気が\n出ない？　でしたら、\nえぇい、元気になぁれ',0);
INSERT INTO room_unit_comments(rowid,id,unit_id,"trigger",voice_id,beloved_step,time,face_id,description,insert_word_type) VALUES(2258,2401,107701,2,2,1,2,1,'お腹がぺこぺこなら、\nお昼は海の家で\n食べましょう♪',0);
INSERT INTO room_unit_comments(rowid,id,unit_id,"trigger",voice_id,beloved_step,time,face_id,description,insert_word_type) VALUES(2259,2402,107701,2,3,1,3,1,'夜の浜辺でお散歩も\nいいですね。たくさん\n転びそうですけど…',0);
INSERT INTO room_unit_comments(rowid,id,unit_id,"trigger",voice_id,beloved_step,time,face_id,description,insert_word_type) VALUES(2260,2404,107701,3,2,1,0,1,'休憩しながら、\nお掃除すれば\n一石二鳥です！',0);
INSERT INTO room_unit_comments(rowid,id,unit_id,"trigger",voice_id,beloved_step,time,face_id,description,insert_word_type) VALUES(2261,2405,107701,3,3,1,0,1,'綺麗にすれば\nかわいさも倍増\nですよ～♪',0);
INSERT INTO room_unit_comments(rowid,id,unit_id,"trigger",voice_id,beloved_step,time,face_id,description,insert_word_type) VALUES(2262,2406,107701,3,4,1,0,1,'素敵な香りです～\n救護院に置けば、\nみんな喜ぶかも～',0);
INSERT INTO room_unit_comments(rowid,id,unit_id,"trigger",voice_id,beloved_step,time,face_id,description,insert_word_type) VALUES(2263,2407,107701,3,5,1,0,1,'あったかいですね…\nはっ！　いけません！\nメイドがサボるなんて',0);
INSERT INTO room_unit_comments(rowid,id,unit_id,"trigger",voice_id,beloved_step,time,face_id,description,insert_word_type) VALUES(2264,2409,107701,3,7,1,0,1,'料理のできない\nメイドなんて…\nはぐはぐ、おいしい♪',0);
INSERT INTO room_unit_comments(rowid,id,unit_id,"trigger",voice_id,beloved_step,time,face_id,description,insert_word_type) VALUES(2265,2410,107701,3,8,1,0,1,'水着姿で接客をすると\n売り上げが倍になる\n…本当ですか、これ',0);
