INSERT INTO unit_background(unit_id,unit_name,bg_id,bg_name,position,face_type) VALUES(107701,'スズメ（サマー）',500164,'マルジェン海岸',0.0,4);
INSERT INTO unit_comments(id,unit_id,use_type,voice_id,face_id,change_time,change_face,description) VALUES(1077001,107701,1,1,1,2.8,5,'働くのって楽しいですね！\nあなたと一緒だと、もっと\n楽しく感じちゃいます♪');
INSERT INTO unit_comments(id,unit_id,use_type,voice_id,face_id,change_time,change_face,description) VALUES(1077002,107701,1,2,1,2.9,2,'休憩時間に海へ\n行きたいんですか？\nもちろん、いいですよ～\n一緒に泳ぎましょう！');
INSERT INTO unit_comments(id,unit_id,use_type,voice_id,face_id,change_time,change_face,description) VALUES(1077003,107701,1,3,4,6.2,2,'私ドジだから、砂のお城って\n完成させたことないんです～\n…一緒に作ってくれるんですか？\nありがとうございます♪');
INSERT INTO unit_comments(id,unit_id,use_type,voice_id,face_id,change_time,change_face,description) VALUES(1077004,107701,1,4,1,4.2,2,'水着姿を褒めて下さるのは\n嬉しいですが…あ、あまり\n見つめられると恥ずかしいです～');
INSERT INTO unit_comments(id,unit_id,use_type,voice_id,face_id,change_time,change_face,description) VALUES(1077005,107701,1,5,1,4.7,5,'御用はありますか？\nもしもなくても…\nお、おそばにいても\nいいですか？');
INSERT INTO unit_comments(id,unit_id,use_type,voice_id,face_id,change_time,change_face,description) VALUES(1077006,107731,1,1,1,0.0,1,'まさか足元に花火があるなんて～！\n子供たちは危険ですから、\n離れてください！\nひゃう！　あつい～っ！');
INSERT INTO unit_comments(id,unit_id,use_type,voice_id,face_id,change_time,change_face,description) VALUES(1077007,107731,1,2,1,0.0,1,'だ、大惨事です～！\nきれいとか言ってる場合じゃ\nありませんから～！');
INSERT INTO unit_comments(id,unit_id,use_type,voice_id,face_id,change_time,change_face,description) VALUES(1077008,107731,1,3,1,0.0,1,'みんなで花火をするのって\nとっても楽しいですね\n今度は両手持ちで\n行きますよ～♪');
INSERT INTO unit_comments(id,unit_id,use_type,voice_id,face_id,change_time,change_face,description) VALUES(1077009,107731,1,4,1,0.0,1,'二人で花火をしてると\n恋人同士に見えるんでしょうか？\nなんて…えへへ☆');
INSERT INTO unit_comments(id,unit_id,use_type,voice_id,face_id,change_time,change_face,description) VALUES(1077010,107731,1,5,1,0.0,1,'あ、あなたにも、お仕えさせて\nもらえませんか？\nや、やっぱり、今の言葉は\n忘れてください！');
